import React from 'react'
import './style.css';

export default function Authentication() {

  //      component: sign in 탭 컴포넌트        //
  const SignInTab = () => {

    //      render: sign in 탭 컴포넌트 렌더링      //
    return(
      <div></div>
    );
  };

  //      component: sign up 탭 컴포넌트      //
  const SignUpTab = () => {

    //      render: sign up 탭 컴포넌트 렌더링      //
    return(
      <div className='auth-box'>
        <div className='auth-top-box'>
          <div className='auth-top-title-box'>
            <div className='auth-top-title'>{'갓생살기'}</div>
          </div>
          <div className='auth-top-message'>{'계속하려면 새로운 계정을 만드세요'}</div>
        </div>
        <div className='auth-middle-box'>
          {/* <InputBox /> */}
          <div className='auth-button'>{'가입'}</div>
          <div className='auth-termsofuse'>{`가입하면 Atlassian Cloud 이용 약관에 동의하고\n개인정보 보호정책을 인정한 것으로 간주됩니다.`}</div>
        </div>
        <div className='auth-bottom-box'>
          <div className='auth-create-account-message'></div>
          <div className='multiple login'></div>
          <div></div>
        </div>
      </div>
    );
  }

  //      render: 인증 페이지 렌더링      //
  return (
    <div id='auth-wrapper'>
      <SignUpTab />
      {/* <div className='login-box'>
        <div className='login-title'>갓생살기</div>
        <div className='login-sub-title'>로그인을 할 수 없습니까?</div>
        <div className='login-to-link-text'>다음으로 복구 링크 보내기</div>
        <input className='input-box' placeholder='이메일을 입력하세요.'></input>
        <div className='login-to-link-send'>
          <div className='login-to-link-send-text'>복구 링크 보내기</div>
        </div>
        <div className='login-return-text'>로그인으로 돌아가기</div>
      </div>
      <div className='back-image-people'></div> */}
    </div>
  )
}
